import React, { Component } from 'react';
import header_bg from '../../assets/images/header_bg.jpg';

export class Header extends Component {
  render() {
    return (
      <div>
        <header>
          <img src={header_bg} className="responsive-img" />
        </header>
      </div>
    )
  }
}

export default Header;
